import java.io.BufferedReader;
import java.io.IOException;
import java.io.InputStreamReader;
import java.util.StringTokenizer;
import java.util.*;

public class Main {
    static class Solution {
        public boolean isAnagram(String s, String t) {
            if (s.length() != t.length()){
                return false;
            }
            
            HashMap<Character, Integer> s_map = makeMap(s);
            HashMap<Character, Integer> t_map = makeMap(t);

            for (char c = 'a'; c <= 'z'; ++c) {
                Integer a = s_map.get(c);
                Integer b = t_map.get(c);
                if (a == null && b == null) {
                    continue;
                } else if (!a.equals(b)) {
                    return false;
                }
            }
            
            return true;
        }
        private HashMap<Character, Integer> makeMap(String s) {
            HashMap<Character, Integer> s_map = new HashMap<>();
            for (int i = 0; i < s.length(); ++i) {
                Integer count = s_map.get(s.charAt(i));
                s_map.put(s.charAt(i), count == null ? 1 : count + 1);
            }
            return s_map;
        }
    }

    public static void main(String[] args) {
        // write your code here
        String[] ss = {
""
,
""
        };
        Solution s = new Solution();
        System.out.println(s.isAnagram(ss[0], ss[1]));
    }
}
